<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8">
    <title>VamOSGS</title>
    <script type="text/javascript">
        var segmentCount = 0;
        var l = window.location;
        l.replace(
            l.protocol + '//' + l.hostname + (l.port ? ':' + l.port : '') +
            l.pathname.split('/').slice(0, 1 + segmentCount).join('/') + '/?p=/' +
            l.pathname.slice(1).split('/').slice(segmentCount).join('/').replace(/&/g, '~and~') +
            (l.search ? '&q=' + l.search.slice(1).replace(/&/g, '~and~') : '') +
            l.hash
        );
    </script>
</head>

<body>
<script type="text/javascript" src="react.13f4d53d40907a607c13.js"></script><script type="text/javascript" src="app.bundle.2f712b05954751bd16d1.js"></script></body>

</html>
